!function(){"use strict";let t=null;window.FireCrystalCSVLoader={load:async function(){try{const t=await fetch("assets/fire_crystals_costs.csv"),r=(await t.text()).trim().split("\n"),s=(r[0].split(","),{});for(let t=1;t<r.length;t++){const a=r[t].split(","),e=a[0],n=a[1],c=parseInt(a[2])||0,l=parseInt(a[3])||0;s[e]||(s[e]={}),s[e][n]={fc:c,rfc:l}}return s}catch(t){return console.error("Error loading fire crystal costs CSV:",t),null}},getData:()=>t,setData:r=>{t=r}}}();